Psych is an American crime/mystery comedy television series that premiered on July 7, 2006 on USA Network. It is the network's longest running current original series. It stars James Roday as Shawn Spencerwho uses his eidetic memory with the observational and investigative skills that his father ingrained in him during childhood to fake being a psychic who consults with the Santa Barbara Police Department to solve cases, as well as running a psychic detective agency called Psych. He is (reluctantly) helped in his charade by his best friend, Burton &quot;Gus&quot; Guster (DulÃƒÂ© Hill), and his father, Henry Spencer (Corbin Bernsen). He generally works with police detectives Carlton Lassiter (Timothy Omundson) and Juliet O'Hara (Maggie Lawson) and under the direction of Police Chief Karen Vick (Kirsten Nelson). Episodes usually begin with a flashback to Shawn's youth, showcasing one of Henry's lessons for his son. These lessons are typically used or applied later in the episode.
As of April 24, 2013, 104 episodes of Psych have aired.
